INSERT INTO `wp_options` (`option_id`, `option_name`, `option_value`, `autoload`) VALUES
(1473, 'edd_sl_609ae11585be436291a4a56797acb272', 'a:2:{s:7:\"timeout\";i:1572480054;s:5:\"value\";s:75154:\"{\"new_version\":\"2.6.5\",\"stable_version\":\"2.6.5\",\"name\":\"Polylang Pro\",\"slug\":\"polylang\",\"url\":\"https:\\/\\/polylang.pro\\/downloads\\/polylang-pro\\/?changelog=1\",\"last_updated\":\"3 weeks ago\",\"homepage\":\"https:\\/\\/polylang.pro\\/downloads\\/polylang-pro\\/\",\"sections\":{\"description\":\"<p>Polylang Pro offers all the awesomeness of Polylang plus extra features and Premium support.<\\/p>\\n\",\"changelog\":\"<p>2.6.5 (2019-10-09)<\\/p>\\n<ul>\\n<li>Pro: Require ACF 5.7.11+ to activate the compatibility to avoid fatal errors with older versions<\\/li>\\n<li>Pro: Avoid translating empty front slug (could cause a wrong redirect to \\/wp-admin)<\\/li>\\n<li>Pro: Fix filter wp_unique_term_slug not always correctly applied.<\\/li>\\n<li>Pro: Fix a conflict with Divi causing post synchronization buttons to be displayed multiple times<\\/li>\\n<li>Avoid notice in WP CLI context<\\/li>\\n<\\/ul>\\n<p>2.6.4 (2019-08-27)<\\/p>\\n<ul>\\n<li>Pro: Fix a conflict preventing meta synchronization when ACF is active<\\/li>\\n<li>Pro: Fix post metas not correctly copied when translating a Beaver Builder page<\\/li>\\n<li>Pro: Fix a fatal error when posts made with Elementor are synchronized<\\/li>\\n<li>Pro: Fix Prewiew button not working correctly when using one domain per language<\\/li>\\n<li>Pro: Fix post synchronization not available for WP CRON and WP CLI<\\/li>\\n<li>Fix future posts not available in the autocomplete input field of the languages metabox<\\/li>\\n<li>Fix translations files not loaded on REST requests<\\/li>\\n<li>Fix deleted term parent not synchronized<\\/li>\\n<\\/ul>\\n<p>2.6.3 (2019-08-06)<\\/p>\\n<ul>\\n<li>Pro: Fix fatal error when updating an ACF field from frontend<\\/li>\\n<li>Pro: Add action \'pll_post_synchronized\'<\\/li>\\n<li>Allow to get the current or default language object using the API. Props Jory Hogeveen. #359<\\/li>\\n<li>Fix empty span in languages switcher widget when showing only flags<\\/li>\\n<li>Fix wpml_register_single_string when updating the original string<\\/li>\\n<\\/ul>\\n<p>2.6.2 (2019-07-16)<\\/p>\\n<ul>\\n<li>Pro: Fix slow admin in case the translations update server can\'t be reached<\\/li>\\n<li>Pro: Fix value not correctly translated for ACF clone fields in repeater<\\/li>\\n<li>Fix strings translations mixed when registered via the WPML compatibility. #381<\\/li>\\n<\\/ul>\\n<p>2.6.1 (2019-07-03)<\\/p>\\n<ul>\\n<li>Pro: Fix Yoast SEO sitemap for inactive languages when using subdomains or multiple domains<\\/li>\\n<li>Fix fatal error in combination with Yoast SEO and Social Warfare<\\/li>\\n<li>Fix post type archive url in Yoast SEO sitemap<\\/li>\\n<\\/ul>\\n<p>2.6 (2019-06-26)<\\/p>\\n<ul>\\n<li>Pro: Remove all languages files. All translations are now maintained on TranslationsPress<\\/li>\\n<li>Pro: Move the languages metabox to a block editor plugin<\\/li>\\n<li>Pro: Better management of user capabilities when synchronizing posts<\\/li>\\n<li>Pro: Separate REST requests from the frontend<\\/li>\\n<li>Pro: Copy the post slug when duplicating a post<\\/li>\\n<li>Pro: Duplicate ACF term metas when terms are automatically duplicated when creating a new post translation<\\/li>\\n<li>Pro: Fix hierarchy lost when duplicating terms<\\/li>\\n<li>Pro: Fix page shared slugs with special characters<\\/li>\\n<li>Pro: Fix synchronized posts sharing their slug when the language is set from the content<\\/li>\\n<li>Pro: Fix PHP warning with ACF Pro 5.8.1<\\/li>\\n<li>Pro: Fix ACF clone fields not translated in repeaters<\\/li>\\n<li>Better management of user capablities when synchronizing taxonomies terms and custom fields<\\/li>\\n<li>Extend string translations search to translated strings #207<\\/li>\\n<li>Update plugin updater to 1.6.18<\\/li>\\n<li>Honor the filter `pll_flag` when performing the flag validation when creating a new language<\\/li>\\n<li>Modify the title and the label for the language switcher menu items #307<\\/li>\\n<li>Add support for international domain names<\\/li>\\n<li>Add a title to the link icon used to add a translation #325<\\/li>\\n<li>Add a notice when a static front page is not translated in a language<\\/li>\\n<li>Add support for custom term fields in wpml-config.xml<\\/li>\\n<li>Add filter `pll_admin_languages_filter` for the list of items the admin bar language filter<\\/li>\\n<li>Add compatibility with WP Offload Media Lite. Props Daniel Berkman<\\/li>\\n<li>Yoast SEO: Add post type archive url in all languages to the sitemap<\\/li>\\n<li>Fix www. not redirected to not www. for the home page in multiple domains #311<\\/li>\\n<li>Fix cropped images not being synchronized<\\/li>\\n<li>Fix auto added page to menus when the page is created with the block editor<\\/li>\\n<li>Fix embed of translated static front page #318<\\/li>\\n<li>Fix a possible infinite redirect if the static front page is not translated<\\/li>\\n<li>Fix incorrect behavior of action \'wpml_register_single_string\' when updating the string source<\\/li>\\n<li>Fix fatal error with Jetpack when no languages has been defined yet #330<\\/li>\\n<li>Fix a conflict with Laravel Valet. Props @chesio. #250<\\/li>\\n<li>Fix a conflict with Thesis.<\\/li>\\n<li>Fix a conflict with Pods in the block editor. Props Jory Hogeveen. #369<\\/li>\\n<li>Fix fatal error with Twenty Fourteen introduced in version 2.5.4. #374<\\/li>\\n<\\/ul>\\n<p>2.5.4 (2019-05-28)<\\/p>\\n<ul>\\n<li>Add Kannada to the predefined languages list<\\/li>\\n<li>Yoast SEO: Fix primary product cat not copied or synchronized<\\/li>\\n<li>WPMU Domain Mapping: Fix incorrect domain used for the theme<\\/li>\\n<li>Fix style-rtl.css not loaded when the language is set from the content #356<\\/li>\\n<li>Fix Jetpack featured pages not working. Props Anis Ladram. #357<\\/li>\\n<li>Fix Call to undefined function wp_generate_attachment_metadata()<\\/li>\\n<\\/ul>\\n<p>2.5.3 (2019-04-16)<\\/p>\\n<ul>\\n<li>Add de_AT and pt_AO to the predefined languages list<\\/li>\\n<li>Pro: Add filter pll_translate_blocks<\\/li>\\n<li>Pro: fix PHP notice when the queried post type has been modified to an array<\\/li>\\n<li>Pro: fix PHP warning when combined with The Event Calendar and Page builder by SiteOrigin<\\/li>\\n<\\/ul>\\n<p>2.5.2 (2019-02-12)<\\/p>\\n<ul>\\n<li>Pro: Fix translated slugs not accepting forward slashes<\\/li>\\n<li>Pro: Fix fatal error with ACF Pro 5.7.11<\\/li>\\n<li>Fix parent categories incorrectly synchronized #327<\\/li>\\n<\\/ul>\\n<p>2.5.1 (2019-01-16)<\\/p>\\n<ul>\\n<li>Security: Fix categories and media duplication not protected from CSRF<\\/li>\\n<li>Pro: Allow to update the plugin with WP CLI<\\/li>\\n<li>Pro: Fix search in the button block not filtered in the correct language (needs WP 5.1)<\\/li>\\n<li>Add Saraiki to the predefined languages list<\\/li>\\n<li>Fix a conflict causing a blank page with Divi<\\/li>\\n<\\/ul>\\n<p>2.5 (2018-12-06)<\\/p>\\n<ul>\\n<li>Add compatibility with WP 5.0<\\/li>\\n<li>Fix custom flags when the WP content folder is not in the WP install folder<\\/li>\\n<li>Fix PHP notice if a language has no flag<\\/li>\\n<\\/ul>\\n<p>2.4.1 (2018-11-27)<\\/p>\\n<ul>\\n<li>Pro: Add compatibility with REST API changes made in WP 5.0<\\/li>\\n<li>Pro: Fix sticky posts in the REST API<\\/li>\\n<li>Pro: Fix overwritten custom post slug when the post is updated with the REST API<\\/li>\\n<li>Pro: Fix bulk translate for media<\\/li>\\n<li>Fix a conflict with Custom sidebars and Content aware sidebars<\\/li>\\n<li>Fix a conflict with the theme Pokemania<\\/li>\\n<li>Fix PHP notices when using the function \'icl_link_to_element\' for terms<\\/li>\\n<li>Fix title slugs for posts written in German<\\/li>\\n<\\/ul>\\n<p>2.4 (2018-11-12)<\\/p>\\n<ul>\\n<li>Minimum WordPress version is now 4.7<\\/li>\\n<li>Pro: Add the possibility to bulk duplicate or bulk synchronize posts.<\\/li>\\n<li>Pro: Add compatibility with Admin Columns<\\/li>\\n<li>Pro: Add synchronized posts to the REST API<\\/li>\\n<li>Pro: Fix variations messed when changing WooCommerce attributes slugs<\\/li>\\n<li>Pro: Fix incorrect language for ajax requests made on front by The Events Calendar<\\/li>\\n<li>Pro: Fix term not duplicated correctly when the language is set from the content<\\/li>\\n<li>Refactor the core to activate on front and for the REST api actions that were previously available only in the backend (language checks, synchronizations...).<\\/li>\\n<li>Add flags to widgets displayed in only one language (Props Jory Hogeveen) #257<\\/li>\\n<li>Honor \'pll_the_language_args\' for all options in menus #237<\\/li>\\n<li>Add better filters for default flags and custom flags<\\/li>\\n<li>Custom flags can now be stored in the polylang directory in the theme<\\/li>\\n<li>Custom flags can now use SVG<\\/li>\\n<li>Add compatibility with Jetpack featured content module<\\/li>\\n<li>Fix Twenty Fourteen featured posts possibly not filtered per language<\\/li>\\n<li>Fix home url not working with WordPress MU Domain mapping<\\/li>\\n<li>Fix Assigning a parent category breaking the hierarchy of translated category<\\/li>\\n<li>Fix: Accept 0,1 and 1.0 as q factors in browser preferred language detection (Props Dominic Rubas)<\\/li>\\n<li>Fix performance issue when using hundreds of widgets<\\/li>\\n<li>Fix translations possibly wrong if the post language is changed without saving the post after<\\/li>\\n<\\/ul>\\n<p>2.3.11 (2018-10-03)<\\/p>\\n<ul>\\n<li>Pro: Add action \'pll_created_sync_post\'<\\/li>\\n<li>Pro: Fix language and translations not included for tags in the REST API<\\/li>\\n<li>Fix Assigning a parent category breaking the hierarchy of translated category<\\/li>\\n<\\/ul>\\n<p>2.3.10 (2018-08-16)<\\/p>\\n<ul>\\n<li>Fix Lingotek notice not dismissable<\\/li>\\n<li>Fix fatal error with the widget calendar<\\/li>\\n<\\/ul>\\n<p>2.3.9 (2018-08-14)<\\/p>\\n<ul>\\n<li>Add a notice to inform about Polylang for WooCommerce<\\/li>\\n<li>Deprecate PLL_Pointer<\\/li>\\n<li>Fix bulk editing pages with no language breaking hierarchy #281<\\/li>\\n<li>Fix an edge case where rewrite rules could be messed on a multisite<\\/li>\\n<li>MU Domain Mapping: fix secondary domain redirected to primary domain<\\/li>\\n<\\/ul>\\n<p>2.3.8 (2018-07-16)<\\/p>\\n<ul>\\n<li>Pro: Duplicate term meta when duplicating a post creates new terms<\\/li>\\n<li>Pro: Add compatibility with ACF Pro when it\'s bundled with the theme<\\/li>\\n<li>Pro: Fix a fatal error when duplicating posts<\\/li>\\n<li>Set cookie during the home redirect<\\/li>\\n<li>Accept a port in the url to detect the site home<\\/li>\\n<li>Add filter \'pll_is_cache_active\' to allow to load the cache compatibility #270 #274<\\/li>\\n<li>Fix potential fatal error when a 3rd party misuses the \'wpml_active_languages\' filter #268<\\/li>\\n<li>Fix Uncaught TypeError: s.split is not a function. Props Wouter Van Vliet #262<\\/li>\\n<li>Fix text alignment for RTL scripts in Lingotek panel #247<\\/li>\\n<li>Fix html language attribute filter on admin<\\/li>\\n<li>Fix cookie expiration time when set in js. Props Jens Nachtigall #271<\\/li>\\n<li>Fix fatal error when a 3rd party misuses the WP_Query tax_query param. Props JanneAalto #252<\\/li>\\n<li>Fix an edge case which could mess home pages on a multisite<\\/li>\\n<\\/ul>\\n<p>2.3.7 (2018-06-07)<\\/p>\\n<ul>\\n<li>Pro: The Events Calendar: Fix untranslated events shown in all languages<\\/li>\\n<li>Avoid displaying edit links of translations of the privacy policy page to non-admin<\\/li>\\n<li>Fix draft created when creating a new page on multisite<\\/li>\\n<li>Do not prevent using the cache for home when using WP Rocket 3.0.5 or later #236<\\/li>\\n<li>Fix language filter applied to wrong queries on admin side<\\/li>\\n<\\/ul>\\n<p>2.3.6 (2018-05-17)<\\/p>\\n<ul>\\n<li>Pro: Fix post type archive slug not translated in ACF page link fields<\\/li>\\n<li>WP 4.9.6: Translate the privacy policy page<\\/li>\\n<li>WP 4.9.6: Add the translated user descriptions to exported personal data<\\/li>\\n<li>Update Plugin updater to version 1.6.16<\\/li>\\n<li>Fix conflict with the plugin View Admin As. Props Jory Hogeveen. #253<\\/li>\\n<\\/ul>\\n<p>2.3.5 (2018-05-08)<\\/p>\\n<ul>\\n<li>Pro: Fix translated CPT slugs when one CPT name is a substring of another one. Props Steve Reimer.<\\/li>\\n<li>Pro: Fix canonical redirection for post types archives when the CPT slug is translated<\\/li>\\n<li>Pro: Fix ACF private key uselessly synchronized when the public custom field is not synchronized<\\/li>\\n<li>Add filter \'pll_filter_query_excluded_query_vars\'<\\/li>\\n<li>Redirect www. to non www. when using multiple domains<\\/li>\\n<li>Fix Yoast SEO category sitemap not filtered by language when using multiple domains<\\/li>\\n<li>Fix PLL_COOKIE === false not honored when using a cache plugin. #248<\\/li>\\n<li>Fix empty predefined languages list<\\/li>\\n<\\/ul>\\n<p>2.3.4 (2018-03-27)<\\/p>\\n<ul>\\n<li>Pro: Fix conflict with Pods related to translated slugs for custom post types<\\/li>\\n<li>Add Friulian to the predefined languages list<\\/li>\\n<li>Fix conflict (javascript error) with G\\u00fctenberg #225<\\/li>\\n<li>Fix conflict on ajax requests introduced by WooCoommerce 3.3.4<\\/li>\\n<li>Fix queries by \'category_name\' not auto translated #238<\\/li>\\n<\\/ul>\\n<p>2.3.3 (2018-03-15)<\\/p>\\n<ul>\\n<li>Pro: Fix tax query using a term sharing slugs (fix a conflict with Fusion Builder)<\\/li>\\n<li>Restore Polylang (free) on REST requests, while disabling the language filter as in v2.3<\\/li>\\n<li>Rework auto translated query with taxonomy in different language #223<\\/li>\\n<li>Synchronize Yoast SEO primary category (needs Yoast SEO 7.0+)<\\/li>\\n<li>Fix PHP warning introduced by Yoast SEO 7.0 #229<\\/li>\\n<li>Fix tax query when using the relation \'OR\'<\\/li>\\n<li>Fix a conflict with the combination of Barrel + WP Bakery Page Builder<\\/li>\\n<li>Fix broken redirect with MU domain mapping #226<\\/li>\\n<li>Fix site title not translated in password change email<\\/li>\\n<\\/ul>\\n<p>2.3.2 (2018-03-05)<\\/p>\\n<ul>\\n<li>Pro: Fix REST requests not filtered by the requested language (introduced in 2.3).<\\/li>\\n<li>Pro: Fix error 404 on single posts if posts are untranslatable<\\/li>\\n<li>Fix translated terms unassigned from posts when deleting a term<\\/li>\\n<li>Fix auto translated query with taxonomy in different language returning empty results since WP 4.9 #223<\\/li>\\n<li>Fix conflict with a homepage option of the theme Extra<\\/li>\\n<li>Fix warning when filtering get_pages()<\\/li>\\n<\\/ul>\\n<p>2.3.1 (2018-02-15)<\\/p>\\n<ul>\\n<li>Pro: Fix GET REST request with slug parameter deleting the post slug<\\/li>\\n<li>Fix http request with a custom query var being redirected to the home page #216<\\/li>\\n<\\/ul>\\n<p>2.3 (2018-01-30)<\\/p>\\n<ul>\\n<li>Pro: Duplicating a post now duplicates untranslated terms and the featured image (if media are translatable)<\\/li>\\n<li>Pro: Add filter \'pll_sync_post_fields\'<\\/li>\\n<li>Pro: Translate ACF Pro clone fields when creating a new field group translation<\\/li>\\n<li>Pro: Allow to share slugs when creating a post or term with the REST API<\\/li>\\n<li>Pro: Load asynchronously the script added on front for multiple domains and subdomains<\\/li>\\n<li>Pro: Fix \'lang\' parameter not interpreted when the query includes \'name\'<\\/li>\\n<li>Refactor the synchronization of metas for better synchronization and performance improvement<\\/li>\\n<li>Refactor the synchronization of taxonomy terms for performance improvement<\\/li>\\n<li>Refactor language and translations saving for performance improvement<\\/li>\\n<li>Refactor the synchronization of sticky posts<\\/li>\\n<li>Remove all languages files. All translations are now maintained on https:\\/\\/translate.wordpress.org\\/projects\\/wp-plugins\\/polylang #199<\\/li>\\n<li>Refactor the list of languages to merge predefined languages, Facebook locales and fixes for W3C locales<\\/li>\\n<li>Automatically deactivate Polylang when activating Polylang Pro<\\/li>\\n<li>Disable programmatically translated post types and taxonomies in settings. Props Ulrich Pogson. #180<\\/li>\\n<li>Set the cookie language in Javascript when a cache plugin is active<\\/li>\\n<li>Automatically remove the home page from cache when requesting the detection of the browser preferred language<\\/li>\\n<li>Use relative urls for the admin language filter in admin bar. #209<\\/li>\\n<li>Disable auto translation of WP_Term_Query if it has a \'lang\' parameter<\\/li>\\n<li>Don\'t filter REST requests by default. #211<\\/li>\\n<li>Fix Yoast SEO statistics in dashboard showing only the default language. #211<\\/li>\\n<li>Fix WP Rocket clearing the cache of the wrong adjacent post<\\/li>\\n<li>Fix random header image<\\/li>\\n<li>Fix home page not correctly loaded when adding a query var<\\/li>\\n<li>Fix: Impossible to change the language code when the language code is also a WordPress locale.<\\/li>\\n<\\/ul>\\n<p>2.2.8 (2018-01-09)<\\/p>\\n<ul>\\n<li>Pro: Fix: Impossible to link past events by translation in The Events Calendar<\\/li>\\n<li>Disallow to delete translations of the default term for all taxonomies<\\/li>\\n<li>Fix: Auto add pages adds WooCommerce pages in default language to menus in all languages<\\/li>\\n<li>Fix most used tag cloud in Tags metabox in WP4.9+. Props P\\u00e4r Thernstr\\u00f6m. #208<\\/li>\\n<\\/ul>\\n<p>2.2.7 (2017-11-30)<\\/p>\\n<ul>\\n<li>Fix queries by taxonomy broken since WP 4.9<\\/li>\\n<li>Fix PHP notice in icl_object_id()<\\/li>\\n<\\/ul>\\n<p>2.2.6 (2017-11-22)<\\/p>\\n<ul>\\n<li>Pro: Fix query by post name and alternative language always returning the post in current language (when sharing slugs)<\\/li>\\n<li>Pro: Fix query by taxonomy and alternative language returning empty results<\\/li>\\n<li>Rework how translation files are loaded in ajax on front when the user is logged (in WP 4.7+)<\\/li>\\n<li>Add filter \'get_objects_with_no_lang_limit\'<\\/li>\\n<li>Force loading the admin side when using WP CLI (Props chrisschrijver)<\\/li>\\n<li>Fix check for terms with no language not scaling<\\/li>\\n<li>Fix pll_count_posts not working with multiple post types<\\/li>\\n<li>Fix inconsistent spacing between flag and language name in language switcher parent menu item (Props Amit Tal)<\\/li>\\n<li>Fix spacing between flag and language name when displaying an RTL language<\\/li>\\n<li>Fix get_terms not accepting comma separated values for \'lang\' parameter (Props Pavlo Zhukov)<\\/li>\\n<li>Fix possible wrong language detected in url when using subdomains (Props Pavlo Zhukov)<\\/li>\\n<li>Fix double escaped query<\\/li>\\n<\\/ul>\\n<p>2.2.5 (2017-11-09)<\\/p>\\n<ul>\\n<li>Update plugin updater class to 1.6.15<\\/li>\\n<li>Add $link in cache key of links filters<\\/li>\\n<li>Add support for \'nav_menu\' post type in wpml_object_id<\\/li>\\n<li>Fix conflict with Timber (introduced in 2.2.4)<\\/li>\\n<\\/ul>\\n<p>2.2.4 (2017-10-26)<\\/p>\\n<ul>\\n<li>Pro: Fix unknown language not redirected to default when using multiple domains<\\/li>\\n<li>Pro: Fix empty \'lang\' query var not deactivating the language query filter<\\/li>\\n<li>Pro: Fix conflict with The Events Calendar and Visual Composer when used together<\\/li>\\n<li>Add new filter `pll_hide_archive_translation_url` #174<\\/li>\\n<li>Add support for undocumented and deprecated WPML functions `wpml_object_id_filter` and `icl_get_current_language`<\\/li>\\n<li>Fix \'orderby\' and \'order\' in `wpml_active_languages`. Needs WP 4.7+<\\/li>\\n<li>Fix `icl_get_languages` not returning all languages when skip_missing = 0. Props Lo\\u00efc Blascos<\\/li>\\n<li>Fix `pll_translate_string` not working on admin #178<\\/li>\\n<li>Fix PHP Warning in widget video in WP 4.9<\\/li>\\n<li>Fix query using \'any\' post type not filtered per language (introduced in 2.2)<\\/li>\\n<li>Fix untranslatable string in About metabox. Props Farhad Sakhaei<\\/li>\\n<li>Fix error with PHP 7.1 and Duplicate Post. Props Enea Scerba<\\/li>\\n<li>Fix query auto translation not active in ajax requests on frontend<\\/li>\\n<li>Fix query auto translation for \'postname\' and \'pagename\'<\\/li>\\n<li>Fix terms query auto translation not working for \'include\' when no taxonomy is provided (WP 4.5+)<\\/li>\\n<\\/ul>\\n<p>2.2.3 (2017-09-24)<\\/p>\\n<ul>\\n<li>Fix editor removed on pages (introduced in 2.2.2)<\\/li>\\n<\\/ul>\\n<p>2.2.2 (2017-09-22)<\\/p>\\n<ul>\\n<li>Pro: Fix Duplicate post button not working when the user meta has been corrupted<\\/li>\\n<li>Fix PHP notice with the plugin Members #175<\\/li>\\n<li>Fix page template select displayed when editing a translated page for posts<\\/li>\\n<li>Fix incompatibility with WP 4.8.2 (placeholder %1$s in prepare)<\\/li>\\n<\\/ul>\\n<p>2.2.1 (2017-08-30)<\\/p>\\n<ul>\\n<li>Pro: partially refactor REST API classes<\\/li>\\n<li>Pro: Fix duplicate content user meta not removed from DB when uninstalling the plugin<\\/li>\\n<li>Fix strings translations not removed from DB when uninstalling the plugin<\\/li>\\n<li>Fix incorrect translation files loaded in ajax on front when the user is logged in (WP 4.7+)<\\/li>\\n<li>Fix widget language dropdown removed when saving a widget (introduced in 2.2)<\\/li>\\n<li>Fix queries with negative values for the \'cat\' parameter (introduced in 2.2 for queries made on frontend)<\\/li>\\n<li>Fix performance issue in combination with some plugins when the language is set from the content (introduced in 2.2)<\\/li>\\n<\\/ul>\\n<p>2.2 (2017-08-16)<\\/p>\\n<ul>\\n<li>Pro: Add support for the REST API<\\/li>\\n<li>Pro: Add integration with The Events Calendar<\\/li>\\n<li>Pro: Refactor ACF Pro integration for post metas and integrate term metas<\\/li>\\n<li>Pro: Ask confirmation if synchronizing a post overwrites an existing translation<\\/li>\\n<li>Pro: Separate sync post logic from interface<\\/li>\\n<li>Pro: Fix \'Detect browser language\' option automatically deactivated<\\/li>\\n<li>Pro: Fix redirect to 404 when the \'page\' slug translation includes non alphanumeric characters.<\\/li>\\n<li>Pro: Fix untranslated post type archive slug<\\/li>\\n<li>Pro: Fix ACF taxonomy fields not copied when the taxonomy is not translated #156<\\/li>\\n<li>Pro: Fix fatal error with ACF4<\\/li>\\n<li>Support a different content text direction in admin #45<\\/li>\\n<li>Add support for wildcards and \'copy-once\' attribute in wpml-config.xml<\\/li>\\n<li>Add minimal support for the filters \'wpml_display_language_names\' and \'icl_ls_languages\'<\\/li>\\n<li>Improve compatibility with the plugin WordPress MU Domain Mapping #116<\\/li>\\n<li>Improve speed of the sticky posts filter #41<\\/li>\\n<li>Remove redirect_lang option for multiple domains and subdomains<\\/li>\\n<li>Use secure cookie when using SSL<\\/li>\\n<li>Allow to copy\\/sync term metas with the filter \'pll_copy_term_metas\'<\\/li>\\n<li>Filter ajax requests in term.php according to the term language<\\/li>\\n<li>Add error message in customizer when setting an untranslated static front page #47<\\/li>\\n<li>Load static page class only if we are using a static front page<\\/li>\\n<li>Refactor parse_query filters to use the same code on frontend and admin<\\/li>\\n<li>Don\'t use add_language_to_link in filters<\\/li>\\n<li>Move ajaxPrefilter footer script on top<\\/li>\\n<li>Use wp_doing_ajax() instead of DOING_AJAX constant<\\/li>\\n<li>Fix queries custom tax not excluded from language filter on admin<\\/li>\\n<li>Fix WP translation not loaded when the language is set from the content on multisite.<\\/li>\\n<li>Fix the list of core post types in PLL_OLT_Manager for WP 4.7+<\\/li>\\n<li>Fix post name and tag slug incorrectly sanitized for German and Danish<\\/li>\\n<li>Fix lang attribute in dropdowns<\\/li>\\n<li>Fix wpml_permalink filter #139<\\/li>\\n<li>Fix WPML constants undefined on backend #151<\\/li>\\n<li>Fix a conflict with the plugin Custom Permalinks #143<\\/li>\\n<li>Fix menu location unexpectedly unset<\\/li>\\n<\\/ul>\\n<p>2.1.6 (2017-07-17)<\\/p>\\n<ul>\\n<li>Pro: fix duplicate post button not working in PHP 7.1<\\/li>\\n<li>Pro: fix CPTUI untranslated labels on admin<\\/li>\\n<li>Adapt related posts filter to use slug instead of name to follow changes made on Jetpack server ( Props Steve Kaeser )<\\/li>\\n<li>Fix PHP notices when translating CPT and custom tax titles in Yoast SEO<\\/li>\\n<li>Fix PHP warning when all plugins are networked activated<\\/li>\\n<\\/ul>\\n<p>2.1.5 (2017-05-31)<\\/p>\\n<ul>\\n<li>Add compatibility with new media widgets introduced in WP 4.8<\\/li>\\n<li>Removing the language information in URL for the default language is now default<\\/li>\\n<li>Update plugin updater class to 1.6.12<\\/li>\\n<li>Pro: fix PHP notices when duplicating the content<\\/li>\\n<li>Fix: test existence of `twentyseventeen_panel_count` instead of relying only on the active template<\\/li>\\n<li>Fix: set current property to false when removing the current-menu-item class #134 props @mowar<\\/li>\\n<li>Fix PHP notice when editing a term without language<\\/li>\\n<li>Fix possible PHP notice when deleting a category<\\/li>\\n<li>Fix fatal error with Gantry 5<\\/li>\\n<\\/ul>\\n<p>2.1.4 (2017-05-16)<\\/p>\\n<ul>\\n<li>Pro: fix user not logged in on secondary domain when previewing changes<\\/li>\\n<li>Pro: fix archive links without language code in ACF link field (ACF 5.4.0+)<\\/li>\\n<li>Fix redirection from www subdomain to wrong language domain.<\\/li>\\n<li>Fix: selecting \\\"Front page displays latest posts\\\" in the customizer not cleaning the languages cache<\\/li>\\n<li>Fix accessibility of the admin language switcher<\\/li>\\n<\\/ul>\\n<p>2.1.3 (2017-04-11)<\\/p>\\n<ul>\\n<li>Pro: Fix translated slug of \'page\' if it is translated to an empty string<\\/li>\\n<li>Update plugin udpater class to 1.6.11<\\/li>\\n<li>Strings registered with a wpml-config.xml file or WPML functions are now multiline by default<\\/li>\\n<li>Translate the site title in emails sent to the user<\\/li>\\n<li>Fix sanitize_user for specific locales<\\/li>\\n<li>Fix deprecation notice in Yoast SEO integration<\\/li>\\n<li>Fix: Clean term cache after the language has been set in mass #119<\\/li>\\n<\\/ul>\\n<p>2.1.2 (2017-03-09)<\\/p>\\n<ul>\\n<li>Pro: Add filter \'pll_xdata_nonce_life\'<\\/li>\\n<li>Pro: Fix translation of WooCommerce product attribute slug<\\/li>\\n<li>Pro: Fix product synchronization in WooCommerce 2.7<\\/li>\\n<li>Pro: Fix error message when bulk trashing synchronized posts<\\/li>\\n<li>Add option to discard item spacing in the output of pll_the_languages() ( Props Ceslav Przywara ) #93 #95<\\/li>\\n<li>Add as, dzo, kab, km, ml_IN, nl_BE, pa_IN, rhg, sah, ta_IN, tah, te, tt_RU to the predefined list of languages<\\/li>\\n<li>Update plugin updater class to 1.6.10<\\/li>\\n<li>Fix: Remove the dependency to is_ssl() to detect the language in the url ( language set from the directory name )<\\/li>\\n<li>Fix issue with secondary level domains<\\/li>\\n<li>Fix strings not translated in emails<\\/li>\\n<li>Fix incorrect usage of add_action() ( Props Peter J. Herrel ) #103<\\/li>\\n<li>Fix wrong redirect in customizer in WP 4.7<\\/li>\\n<\\/ul>\\n<p>2.1.1 (2017-02-15)<\\/p>\\n<ul>\\n<li>Pro: Add filter \'pll_enable_duplicate_media\' for a fine control of automatic media duplication<\\/li>\\n<li>Add filter \'pll_links_model\' for the links model class name<\\/li>\\n<li>Trim any starting ^ from modified rewrite rules<\\/li>\\n<li>Pro: Fix wrong count of plugins to udpate<\\/li>\\n<li>Fix slashed strings translations not saved #94<\\/li>\\n<\\/ul>\\n<p>2.1 (2017-01-25)<\\/p>\\n<ul>\\n<li>Minimum WordPress version is now 4.4<\\/li>\\n<li>Pro: Add support for synchronized posts (same post in multiple languages)<\\/li>\\n<li>Pro: Add support for custom post type UI and the Divi Builder<\\/li>\\n<li>Improve support of Yoast SEO (no category base and post type archive breadcrumb title)<\\/li>\\n<li>Move Languages menu at top level instead of submenu of the WordPress settings<\\/li>\\n<li>Copy the original post date when creating a translation and when the date is synchronized (Props Jory Hogeveen) #32<\\/li>\\n<li>Remove hreflang attributes on paged pages and paged posts<\\/li>\\n<li>Add label to widget language dropdown for better accessibility (Props Lawrence Francell) #53 #56<\\/li>\\n<li>Remove constants POLYLANG_URL and PLL_LOCAL_URL<\\/li>\\n<li>wp_get_sidebars_widgets() and is_active_sidebar() are now filtered according to widgets languages #54<\\/li>\\n<li>Add functions pll_esc_html__(), pll_esc_html_e(), pll_esc_attr__() and pll_esc_attr_e() to the API (Props jegbagus) #83<\\/li>\\n<li>Pro: Fix conflict between WooCommerce shop on front and translated shop base slug<\\/li>\\n<li>Pro: Fix $wp_rewrite search base and author_base not translated #68<\\/li>\\n<li>Pro: Fix page preview does not log in the user when using sudomains<\\/li>\\n<li>Fix: avoid setting the language cookie on 404 pages<\\/li>\\n<li>Fix: rewrite rules order modified for custom post types archives<\\/li>\\n<li>Fix: conflict with WP All Import causing our filters to fail in \\\"Add Media\\\" modal when editing a post<\\/li>\\n<li>Fix: auto add pages not working for nav menus assigned to several locations<\\/li>\\n<li>Fix: Jetpack infinite scroll for multiple domains #58 #74<\\/li>\\n<li>Fix: serialize error in Strings translations when balanceTags option is active #63<\\/li>\\n<li>Fix: static front page preview when redirected from the languages page #49<\\/li>\\n<li>Fix: Auto add pages not working for nav menus assigned to several locations<\\/li>\\n<li>Fix: Conflict with Woocommerce Show Single Variation<\\/li>\\n<li>Fix: Parent page not synchronized in Quick edit (introduced in 2.0.8)<\\/li>\\n<li>Fix: WPML API wpml_element_has_translations and wpml_post_language_details<\\/li>\\n<li>Fix: unattached media translations not in language switcher<\\/li>\\n<li>Fix: Conflict with WP Residence advanced search<\\/li>\\n<\\/ul>\\n<p>2.0.12 (2016-12-19)<\\/p>\\n<ul>\\n<li>Fix plugin not loaded first (introduced in 2.0.11)<\\/li>\\n<li>Fix wrong translations files loaded when the language is set from the content in WP 4.7 #76<\\/li>\\n<li>Fix notice when a tax query has no terms (using EXISTS or NOT EXISTS)<\\/li>\\n<\\/ul>\\n<p>2.0.11 (2016-12-12)<\\/p>\\n<ul>\\n<li>Pro: Fix shared term slugs broken by a late change in WP 4.7 #73<\\/li>\\n<li>Pro: Fix media taxonomies lost when creating a media translation when taxonomies sync is activated #72<\\/li>\\n<li>Fix fatal error in customizer when Twenty Seventen is activated and another theme is previewed #71<\\/li>\\n<li>Fix wrong plugin language on admin if user locale is different from site locale in WP 4.7<\\/li>\\n<\\/ul>\\n<p>2.0.10 (2016-12-05)<\\/p>\\n<ul>\\n<li>Add support for front page panels of Twenty Seventeen<\\/li>\\n<li>Remove draft posts from the language switcher even when the user is logged in<\\/li>\\n<li>Fix: Make argument 2 of icl_object_id optional<\\/li>\\n<li>Fix a conflict with the Divi theme (#67)<\\/li>\\n<\\/ul>\\n<p>2.0.9 (2016-11-15)<\\/p>\\n<ul>\\n<li>Fix javascript error in some ajax requests<\\/li>\\n<\\/ul>\\n<p>2.0.8 (2016-11-14)<\\/p>\\n<ul>\\n<li>Disable admin language feature in WP 4.7+<\\/li>\\n<li>Pro: fix case where a media could lose its parent post when translated on the fly by the content duplication<\\/li>\\n<li>Pro: fix on the fly media created at content duplication attached to parent page instead of child page<\\/li>\\n<li>Fix translations input fields not populated in languages metabox when creating a new translation in WP 4.7<\\/li>\\n<li>Fix possibility to delete the translations of the default category in WP 4.7<\\/li>\\n<li>Fix tag search not filtered per language in Quick edit in WP 4.7<\\/li>\\n<li>Fix dropdown language switcher not working for untranslated pages<\\/li>\\n<\\/ul>\\n<p>2.0.7 (2016-10-18)<\\/p>\\n<ul>\\n<li>Fix issues with static front pages introduced in version 2.0.6<\\/li>\\n<\\/ul>\\n<p>2.0.6 (2016-10-17)<\\/p>\\n<ul>\\n<li>Pro: Fix translated paged slug not working on paged static front page<\\/li>\\n<li>Add support for WPML filter \'wpml_language_form_input_field\'<\\/li>\\n<li>Fix PHP notice when using the WPML filter \'wpml_current_language\'<\\/li>\\n<li>Fix cases where the admin language filter is not correctly taken into account<\\/li>\\n<li>Fix paged static front pages in plain permalinks<\\/li>\\n<li>Fix paged static front pages for multiple domains (#43)<\\/li>\\n<li>Fix warning occuring when a 3rd party plugin attempts to register anything but a string in the strings translations panel<\\/li>\\n<li>Fix cross domain http request for media when using multiple domains or subdomains<\\/li>\\n<li>Fix error 404 on pages when no language has been created yet<\\/li>\\n<\\/ul>\\n<p>2.0.5 (2016-09-22)<\\/p>\\n<ul>\\n<li>Pro: Fix conflict with WPBakery Visual Composer<\\/li>\\n<li>Pro: Fix conflict between multiple domains SSO and FORCE_SSL_ADMIN<\\/li>\\n<li>Pro: Fix duplicated fields not displayed in new translation in ACF Pro 5.4+<\\/li>\\n<li>Add Tibetan and Silesian to the predefined languages list<\\/li>\\n<li>Remove duplicated strings from the strings translations (even when they have a different name or group)<\\/li>\\n<li>The languages and translations of custom post types and taxonomies are no more activated by default at activation<\\/li>\\n<li>Allow to deactivate auto translation in secondary by setting \'lang\' to an empty value<\\/li>\\n<li>Fix: invalidate the cache of PLL_MO ids when adding a new language<\\/li>\\n<li>Fix: don\'t filter secondary queries when editing a post in an untranslated post type<\\/li>\\n<\\/ul>\\n<p>2.0.4 (2016-09-06)<\\/p>\\n<ul>\\n<li>Add Gujarati to the predefined languages list<\\/li>\\n<li>Fix conflict with Page Builder. Other parts of the conflict are fixed in Page Builder 2.4.14<\\/li>\\n<li>Fix plugins translations incorrectly loaded in WP 4.6<\\/li>\\n<li>Fix error 404 on paged urls when using a non standard port<\\/li>\\n<\\/ul>\\n<p>2.0.3 (2016-08-16)<\\/p>\\n<ul>\\n<li>Pro: Fix PHP notice when hiding the language code in url and the language is set from subdomains<\\/li>\\n<li>Pro: Fix one more media being created when the duplicate media in all languages is activated (introduced in 2.0)<\\/li>\\n<li>Pro: Fix shared term slugs not working on PHP 7<\\/li>\\n<li>Pro: Fix Polylang storing integers in some ACF Pro fields where ACF Pro stores strings<\\/li>\\n<li>Pro: Fix ACF Pro custom fields synchronized even when the custom fields synchronization option is deactivated (#40)<\\/li>\\n<li>Fix PHP notice: Undefined variable: original_value in \\/modules\\/wpml\\/wpml-api.php on line 168<\\/li>\\n<li>Fix translations loaded too soon by plugins not correctly reloaded since WP 4.6 (#39)<\\/li>\\n<li>Fix: Remove the delete link for translations of the default category on PHP 7<\\/li>\\n<li>Fix unescaped i18n strings in Lingotek presentation<\\/li>\\n<\\/ul>\\n<p>2.0.2 (2016-08-03)<\\/p>\\n<ul>\\n<li>Avoid fatal error when a 3rd party theme or plugin has a malformed wpml-config.xml file: the malformed wpml-config.xml file is simply ignored<\\/li>\\n<\\/ul>\\n<p>2.0.1 (2016-08-02)<\\/p>\\n<ul>\\n<li>Fix fatal error on PHP &lt; 5.4 (introduced in 2.0)<\\/li>\\n<li>Fix custom flags not being loaded (introduced in 2.0)<\\/li>\\n<\\/ul>\\n<p>2.0 (2016-08-02)<\\/p>\\n<ul>\\n<li>Pro: Improve integration with ACF Pro<\\/li>\\n<li>Pro: Add support for single sign on across multiple domains or subdomains<\\/li>\\n<li>Pro: Add support for browser language detection when using multiple domains<\\/li>\\n<li>Pro: Add support for translation of the static portion of the post permalink structure<\\/li>\\n<li>Pro: Fix deactivated languages appearing in Yoast SEO sitemaps<\\/li>\\n<li>Pro: Fix impossibility to visit a deactivated language when using subdomains or multiple domains (#10)<\\/li>\\n<li>Pro: Fix when sharing slug on the page for posts, only one of them is accessible (#33)<\\/li>\\n<li>Add the possibility to use the language switcher as dropdown in menu<\\/li>\\n<li>Add support for custom logo introduced in WP 4.5 (#6)<\\/li>\\n<li>The backend current language ( PLL()-&gt;curlang ) is now equal to the language of current post or term being edited (#19)<\\/li>\\n<li>The sample permalink is now updated when changing the language in the Languages metabox<\\/li>\\n<li>Revamp the wpml-config.xml reader to use simplexml instead of our custom xml parser<\\/li>\\n<li>Improve support for the WPML API (including Hook API introduced in WPML 3.2)<\\/li>\\n<li>Add support for translation of meta titles and descriptions of custom post types and custom taxonomies in Yoast SEO<\\/li>\\n<li>Replace uncached functions by WPCOM VIP functions when available<\\/li>\\n<li>Improve compatibility with WP 4.6<\\/li>\\n<li>Fix parent category wrongly assigned to post when synchronizing children categories (#21)<\\/li>\\n<li>Fix custom fonts not loaded when using multiple domains or subdomains<\\/li>\\n<li>Fix remove_accents() not working for German and Danish (#24)<\\/li>\\n<li>Fix incorrect static front pages urls on backend<\\/li>\\n<li>Fix impossible to directly enter the page number in strings translation table (introduced in 1.9.3)<\\/li>\\n<li>Fix conflict with WP Sweep (needs WP Sweep 1.0.8+)<\\/li>\\n<li>Fix potential performance issue by querying only taxonomies to show in quick edit to filter the category checklist<\\/li>\\n<li>Fix conflict (database error) with ReOrder-posts-within-categories plugin<\\/li>\\n<li>Fix languages per page option not saved<\\/li>\\n<\\/ul>\\n<p>1.9.3 (2016-06-28)<\\/p>\\n<ul>\\n<li>Pro: Allow to add slashes in url slugs translations<\\/li>\\n<li>\\u00a0Pro: Fix archive links not using translated slugs<\\/li>\\n<li>Pro: Fix visitor being redirected to 404 if his browser preference is set to an inactive language<\\/li>\\n<li>Fix strings translations table always back to page 1 when submitting the form (#14)<\\/li>\\n<li>Fix get_pages( array( \'lang\' =&gt; \'\' ) ) not querying all the languages<\\/li>\\n<li>Fix switching the admin language filter can override the static front page settings (#16)<\\/li>\\n<\\/ul>\\n<p>1.9.2 (2016-06-06)<\\/p>\\n<ul>\\n<li>Pro: fix unreachable hierarchical custom post type posts when they are sharing slugs across languages<\\/li>\\n<li>Fix missing argument 3 in icl_t<\\/li>\\n<li>Fix conflict with WooCommerce product variations<\\/li>\\n<\\/ul>\\n<p>1.9.1 (2016-05-23)<\\/p>\\n<ul>\\n<li>Pro: add compatibility with Beaver Builder<\\/li>\\n<li>Pro: fix media wrongly created when adding a new media translation<\\/li>\\n<li>Add azb, ceb, de_CH_informal, es_GT, mr, nl_NL_formal to the predefined list of languages<\\/li>\\n<li>Fix the language switcher not linking to media translations for anonymous visitors<\\/li>\\n<\\/ul>\\n\"},\"banners\":{\"high\":\"\",\"low\":\"\"},\"icons\":{\"1x\":\"https:\\/\\/polylang.pro\\/wp-content\\/uploads\\/edd\\/2016\\/04\\/polylang-pro.png\",\"2x\":\"https:\\/\\/polylang.pro\\/wp-content\\/uploads\\/edd\\/2016\\/04\\/polylang-pro.png\"},\"tested\":\"4.9.8\",\"compatibility\":\"a:1:{s:5:\\\"4.9.8\\\";a:1:{s:6:\\\"1.5.21\\\";a:3:{i:0;s:4:\\\"100%\\\";i:1;s:1:\\\"5\\\";i:2;s:1:\\\"5\\\";}}}\",\"description\":[\"<p>Polylang Pro offers all the awesomeness of Polylang plus extra features and Premium support.<\\/p>\\n\"],\"changelog\":[\"<p>2.6.5 (2019-10-09)<\\/p>\\n<ul>\\n<li>Pro: Require ACF 5.7.11+ to activate the compatibility to avoid fatal errors with older versions<\\/li>\\n<li>Pro: Avoid translating empty front slug (could cause a wrong redirect to \\/wp-admin)<\\/li>\\n<li>Pro: Fix filter wp_unique_term_slug not always correctly applied.<\\/li>\\n<li>Pro: Fix a conflict with Divi causing post synchronization buttons to be displayed multiple times<\\/li>\\n<li>Avoid notice in WP CLI context<\\/li>\\n<\\/ul>\\n<p>2.6.4 (2019-08-27)<\\/p>\\n<ul>\\n<li>Pro: Fix a conflict preventing meta synchronization when ACF is active<\\/li>\\n<li>Pro: Fix post metas not correctly copied when translating a Beaver Builder page<\\/li>\\n<li>Pro: Fix a fatal error when posts made with Elementor are synchronized<\\/li>\\n<li>Pro: Fix Prewiew button not working correctly when using one domain per language<\\/li>\\n<li>Pro: Fix post synchronization not available for WP CRON and WP CLI<\\/li>\\n<li>Fix future posts not available in the autocomplete input field of the languages metabox<\\/li>\\n<li>Fix translations files not loaded on REST requests<\\/li>\\n<li>Fix deleted term parent not synchronized<\\/li>\\n<\\/ul>\\n<p>2.6.3 (2019-08-06)<\\/p>\\n<ul>\\n<li>Pro: Fix fatal error when updating an ACF field from frontend<\\/li>\\n<li>Pro: Add action \'pll_post_synchronized\'<\\/li>\\n<li>Allow to get the current or default language object using the API. Props Jory Hogeveen. #359<\\/li>\\n<li>Fix empty span in languages switcher widget when showing only flags<\\/li>\\n<li>Fix wpml_register_single_string when updating the original string<\\/li>\\n<\\/ul>\\n<p>2.6.2 (2019-07-16)<\\/p>\\n<ul>\\n<li>Pro: Fix slow admin in case the translations update server can\'t be reached<\\/li>\\n<li>Pro: Fix value not correctly translated for ACF clone fields in repeater<\\/li>\\n<li>Fix strings translations mixed when registered via the WPML compatibility. #381<\\/li>\\n<\\/ul>\\n<p>2.6.1 (2019-07-03)<\\/p>\\n<ul>\\n<li>Pro: Fix Yoast SEO sitemap for inactive languages when using subdomains or multiple domains<\\/li>\\n<li>Fix fatal error in combination with Yoast SEO and Social Warfare<\\/li>\\n<li>Fix post type archive url in Yoast SEO sitemap<\\/li>\\n<\\/ul>\\n<p>2.6 (2019-06-26)<\\/p>\\n<ul>\\n<li>Pro: Remove all languages files. All translations are now maintained on TranslationsPress<\\/li>\\n<li>Pro: Move the languages metabox to a block editor plugin<\\/li>\\n<li>Pro: Better management of user capabilities when synchronizing posts<\\/li>\\n<li>Pro: Separate REST requests from the frontend<\\/li>\\n<li>Pro: Copy the post slug when duplicating a post<\\/li>\\n<li>Pro: Duplicate ACF term metas when terms are automatically duplicated when creating a new post translation<\\/li>\\n<li>Pro: Fix hierarchy lost when duplicating terms<\\/li>\\n<li>Pro: Fix page shared slugs with special characters<\\/li>\\n<li>Pro: Fix synchronized posts sharing their slug when the language is set from the content<\\/li>\\n<li>Pro: Fix PHP warning with ACF Pro 5.8.1<\\/li>\\n<li>Pro: Fix ACF clone fields not translated in repeaters<\\/li>\\n<li>Better management of user capablities when synchronizing taxonomies terms and custom fields<\\/li>\\n<li>Extend string translations search to translated strings #207<\\/li>\\n<li>Update plugin updater to 1.6.18<\\/li>\\n<li>Honor the filter `pll_flag` when performing the flag validation when creating a new language<\\/li>\\n<li>Modify the title and the label for the language switcher menu items #307<\\/li>\\n<li>Add support for international domain names<\\/li>\\n<li>Add a title to the link icon used to add a translation #325<\\/li>\\n<li>Add a notice when a static front page is not translated in a language<\\/li>\\n<li>Add support for custom term fields in wpml-config.xml<\\/li>\\n<li>Add filter `pll_admin_languages_filter` for the list of items the admin bar language filter<\\/li>\\n<li>Add compatibility with WP Offload Media Lite. Props Daniel Berkman<\\/li>\\n<li>Yoast SEO: Add post type archive url in all languages to the sitemap<\\/li>\\n<li>Fix www. not redirected to not www. for the home page in multiple domains #311<\\/li>\\n<li>Fix cropped images not being synchronized<\\/li>\\n<li>Fix auto added page to menus when the page is created with the block editor<\\/li>\\n<li>Fix embed of translated static front page #318<\\/li>\\n<li>Fix a possible infinite redirect if the static front page is not translated<\\/li>\\n<li>Fix incorrect behavior of action \'wpml_register_single_string\' when updating the string source<\\/li>\\n<li>Fix fatal error with Jetpack when no languages has been defined yet #330<\\/li>\\n<li>Fix a conflict with Laravel Valet. Props @chesio. #250<\\/li>\\n<li>Fix a conflict with Thesis.<\\/li>\\n<li>Fix a conflict with Pods in the block editor. Props Jory Hogeveen. #369<\\/li>\\n<li>Fix fatal error with Twenty Fourteen introduced in version 2.5.4. #374<\\/li>\\n<\\/ul>\\n<p>2.5.4 (2019-05-28)<\\/p>\\n<ul>\\n<li>Add Kannada to the predefined languages list<\\/li>\\n<li>Yoast SEO: Fix primary product cat not copied or synchronized<\\/li>\\n<li>WPMU Domain Mapping: Fix incorrect domain used for the theme<\\/li>\\n<li>Fix style-rtl.css not loaded when the language is set from the content #356<\\/li>\\n<li>Fix Jetpack featured pages not working. Props Anis Ladram. #357<\\/li>\\n<li>Fix Call to undefined function wp_generate_attachment_metadata()<\\/li>\\n<\\/ul>\\n<p>2.5.3 (2019-04-16)<\\/p>\\n<ul>\\n<li>Add de_AT and pt_AO to the predefined languages list<\\/li>\\n<li>Pro: Add filter pll_translate_blocks<\\/li>\\n<li>Pro: fix PHP notice when the queried post type has been modified to an array<\\/li>\\n<li>Pro: fix PHP warning when combined with The Event Calendar and Page builder by SiteOrigin<\\/li>\\n<\\/ul>\\n<p>2.5.2 (2019-02-12)<\\/p>\\n<ul>\\n<li>Pro: Fix translated slugs not accepting forward slashes<\\/li>\\n<li>Pro: Fix fatal error with ACF Pro 5.7.11<\\/li>\\n<li>Fix parent categories incorrectly synchronized #327<\\/li>\\n<\\/ul>\\n<p>2.5.1 (2019-01-16)<\\/p>\\n<ul>\\n<li>Security: Fix categories and media duplication not protected from CSRF<\\/li>\\n<li>Pro: Allow to update the plugin with WP CLI<\\/li>\\n<li>Pro: Fix search in the button block not filtered in the correct language (needs WP 5.1)<\\/li>\\n<li>Add Saraiki to the predefined languages list<\\/li>\\n<li>Fix a conflict causing a blank page with Divi<\\/li>\\n<\\/ul>\\n<p>2.5 (2018-12-06)<\\/p>\\n<ul>\\n<li>Add compatibility with WP 5.0<\\/li>\\n<li>Fix custom flags when the WP content folder is not in the WP install folder<\\/li>\\n<li>Fix PHP notice if a language has no flag<\\/li>\\n<\\/ul>\\n<p>2.4.1 (2018-11-27)<\\/p>\\n<ul>\\n<li>Pro: Add compatibility with REST API changes made in WP 5.0<\\/li>\\n<li>Pro: Fix sticky posts in the REST API<\\/li>\\n<li>Pro: Fix overwritten custom post slug when the post is updated with the REST API<\\/li>\\n<li>Pro: Fix bulk translate for media<\\/li>\\n<li>Fix a conflict with Custom sidebars and Content aware sidebars<\\/li>\\n<li>Fix a conflict with the theme Pokemania<\\/li>\\n<li>Fix PHP notices when using the function \'icl_link_to_element\' for terms<\\/li>\\n<li>Fix title slugs for posts written in German<\\/li>\\n<\\/ul>\\n<p>2.4 (2018-11-12)<\\/p>\\n<ul>\\n<li>Minimum WordPress version is now 4.7<\\/li>\\n<li>Pro: Add the possibility to bulk duplicate or bulk synchronize posts.<\\/li>\\n<li>Pro: Add compatibility with Admin Columns<\\/li>\\n<li>Pro: Add synchronized posts to the REST API<\\/li>\\n<li>Pro: Fix variations messed when changing WooCommerce attributes slugs<\\/li>\\n<li>Pro: Fix incorrect language for ajax requests made on front by The Events Calendar<\\/li>\\n<li>Pro: Fix term not duplicated correctly when the language is set from the content<\\/li>\\n<li>Refactor the core to activate on front and for the REST api actions that were previously available only in the backend (language checks, synchronizations...).<\\/li>\\n<li>Add flags to widgets displayed in only one language (Props Jory Hogeveen) #257<\\/li>\\n<li>Honor \'pll_the_language_args\' for all options in menus #237<\\/li>\\n<li>Add better filters for default flags and custom flags<\\/li>\\n<li>Custom flags can now be stored in the polylang directory in the theme<\\/li>\\n<li>Custom flags can now use SVG<\\/li>\\n<li>Add compatibility with Jetpack featured content module<\\/li>\\n<li>Fix Twenty Fourteen featured posts possibly not filtered per language<\\/li>\\n<li>Fix home url not working with WordPress MU Domain mapping<\\/li>\\n<li>Fix Assigning a parent category breaking the hierarchy of translated category<\\/li>\\n<li>Fix: Accept 0,1 and 1.0 as q factors in browser preferred language detection (Props Dominic Rubas)<\\/li>\\n<li>Fix performance issue when using hundreds of widgets<\\/li>\\n<li>Fix translations possibly wrong if the post language is changed without saving the post after<\\/li>\\n<\\/ul>\\n<p>2.3.11 (2018-10-03)<\\/p>\\n<ul>\\n<li>Pro: Add action \'pll_created_sync_post\'<\\/li>\\n<li>Pro: Fix language and translations not included for tags in the REST API<\\/li>\\n<li>Fix Assigning a parent category breaking the hierarchy of translated category<\\/li>\\n<\\/ul>\\n<p>2.3.10 (2018-08-16)<\\/p>\\n<ul>\\n<li>Fix Lingotek notice not dismissable<\\/li>\\n<li>Fix fatal error with the widget calendar<\\/li>\\n<\\/ul>\\n<p>2.3.9 (2018-08-14)<\\/p>\\n<ul>\\n<li>Add a notice to inform about Polylang for WooCommerce<\\/li>\\n<li>Deprecate PLL_Pointer<\\/li>\\n<li>Fix bulk editing pages with no language breaking hierarchy #281<\\/li>\\n<li>Fix an edge case where rewrite rules could be messed on a multisite<\\/li>\\n<li>MU Domain Mapping: fix secondary domain redirected to primary domain<\\/li>\\n<\\/ul>\\n<p>2.3.8 (2018-07-16)<\\/p>\\n<ul>\\n<li>Pro: Duplicate term meta when duplicating a post creates new terms<\\/li>\\n<li>Pro: Add compatibility with ACF Pro when it\'s bundled with the theme<\\/li>\\n<li>Pro: Fix a fatal error when duplicating posts<\\/li>\\n<li>Set cookie during the home redirect<\\/li>\\n<li>Accept a port in the url to detect the site home<\\/li>\\n<li>Add filter \'pll_is_cache_active\' to allow to load the cache compatibility #270 #274<\\/li>\\n<li>Fix potential fatal error when a 3rd party misuses the \'wpml_active_languages\' filter #268<\\/li>\\n<li>Fix Uncaught TypeError: s.split is not a function. Props Wouter Van Vliet #262<\\/li>\\n<li>Fix text alignment for RTL scripts in Lingotek panel #247<\\/li>\\n<li>Fix html language attribute filter on admin<\\/li>\\n<li>Fix cookie expiration time when set in js. Props Jens Nachtigall #271<\\/li>\\n<li>Fix fatal error when a 3rd party misuses the WP_Query tax_query param. Props JanneAalto #252<\\/li>\\n<li>Fix an edge case which could mess home pages on a multisite<\\/li>\\n<\\/ul>\\n<p>2.3.7 (2018-06-07)<\\/p>\\n<ul>\\n<li>Pro: The Events Calendar: Fix untranslated events shown in all languages<\\/li>\\n<li>Avoid displaying edit links of translations of the privacy policy page to non-admin<\\/li>\\n<li>Fix draft created when creating a new page on multisite<\\/li>\\n<li>Do not prevent using the cache for home when using WP Rocket 3.0.5 or later #236<\\/li>\\n<li>Fix language filter applied to wrong queries on admin side<\\/li>\\n<\\/ul>\\n<p>2.3.6 (2018-05-17)<\\/p>\\n<ul>\\n<li>Pro: Fix post type archive slug not translated in ACF page link fields<\\/li>\\n<li>WP 4.9.6: Translate the privacy policy page<\\/li>\\n<li>WP 4.9.6: Add the translated user descriptions to exported personal data<\\/li>\\n<li>Update Plugin updater to version 1.6.16<\\/li>\\n<li>Fix conflict with the plugin View Admin As. Props Jory Hogeveen. #253<\\/li>\\n<\\/ul>\\n<p>2.3.5 (2018-05-08)<\\/p>\\n<ul>\\n<li>Pro: Fix translated CPT slugs when one CPT name is a substring of another one. Props Steve Reimer.<\\/li>\\n<li>Pro: Fix canonical redirection for post types archives when the CPT slug is translated<\\/li>\\n<li>Pro: Fix ACF private key uselessly synchronized when the public custom field is not synchronized<\\/li>\\n<li>Add filter \'pll_filter_query_excluded_query_vars\'<\\/li>\\n<li>Redirect www. to non www. when using multiple domains<\\/li>\\n<li>Fix Yoast SEO category sitemap not filtered by language when using multiple domains<\\/li>\\n<li>Fix PLL_COOKIE === false not honored when using a cache plugin. #248<\\/li>\\n<li>Fix empty predefined languages list<\\/li>\\n<\\/ul>\\n<p>2.3.4 (2018-03-27)<\\/p>\\n<ul>\\n<li>Pro: Fix conflict with Pods related to translated slugs for custom post types<\\/li>\\n<li>Add Friulian to the predefined languages list<\\/li>\\n<li>Fix conflict (javascript error) with G\\u00fctenberg #225<\\/li>\\n<li>Fix conflict on ajax requests introduced by WooCoommerce 3.3.4<\\/li>\\n<li>Fix queries by \'category_name\' not auto translated #238<\\/li>\\n<\\/ul>\\n<p>2.3.3 (2018-03-15)<\\/p>\\n<ul>\\n<li>Pro: Fix tax query using a term sharing slugs (fix a conflict with Fusion Builder)<\\/li>\\n<li>Restore Polylang (free) on REST requests, while disabling the language filter as in v2.3<\\/li>\\n<li>Rework auto translated query with taxonomy in different language #223<\\/li>\\n<li>Synchronize Yoast SEO primary category (needs Yoast SEO 7.0+)<\\/li>\\n<li>Fix PHP warning introduced by Yoast SEO 7.0 #229<\\/li>\\n<li>Fix tax query when using the relation \'OR\'<\\/li>\\n<li>Fix a conflict with the combination of Barrel + WP Bakery Page Builder<\\/li>\\n<li>Fix broken redirect with MU domain mapping #226<\\/li>\\n<li>Fix site title not translated in password change email<\\/li>\\n<\\/ul>\\n<p>2.3.2 (2018-03-05)<\\/p>\\n<ul>\\n<li>Pro: Fix REST requests not filtered by the requested language (introduced in 2.3).<\\/li>\\n<li>Pro: Fix error 404 on single posts if posts are untranslatable<\\/li>\\n<li>Fix translated terms unassigned from posts when deleting a term<\\/li>\\n<li>Fix auto translated query with taxonomy in different language returning empty results since WP 4.9 #223<\\/li>\\n<li>Fix conflict with a homepage option of the theme Extra<\\/li>\\n<li>Fix warning when filtering get_pages()<\\/li>\\n<\\/ul>\\n<p>2.3.1 (2018-02-15)<\\/p>\\n<ul>\\n<li>Pro: Fix GET REST request with slug parameter deleting the post slug<\\/li>\\n<li>Fix http request with a custom query var being redirected to the home page #216<\\/li>\\n<\\/ul>\\n<p>2.3 (2018-01-30)<\\/p>\\n<ul>\\n<li>Pro: Duplicating a post now duplicates untranslated terms and the featured image (if media are translatable)<\\/li>\\n<li>Pro: Add filter \'pll_sync_post_fields\'<\\/li>\\n<li>Pro: Translate ACF Pro clone fields when creating a new field group translation<\\/li>\\n<li>Pro: Allow to share slugs when creating a post or term with the REST API<\\/li>\\n<li>Pro: Load asynchronously the script added on front for multiple domains and subdomains<\\/li>\\n<li>Pro: Fix \'lang\' parameter not interpreted when the query includes \'name\'<\\/li>\\n<li>Refactor the synchronization of metas for better synchronization and performance improvement<\\/li>\\n<li>Refactor the synchronization of taxonomy terms for performance improvement<\\/li>\\n<li>Refactor language and translations saving for performance improvement<\\/li>\\n<li>Refactor the synchronization of sticky posts<\\/li>\\n<li>Remove all languages files. All translations are now maintained on https:\\/\\/translate.wordpress.org\\/projects\\/wp-plugins\\/polylang #199<\\/li>\\n<li>Refactor the list of languages to merge predefined languages, Facebook locales and fixes for W3C locales<\\/li>\\n<li>Automatically deactivate Polylang when activating Polylang Pro<\\/li>\\n<li>Disable programmatically translated post types and taxonomies in settings. Props Ulrich Pogson. #180<\\/li>\\n<li>Set the cookie language in Javascript when a cache plugin is active<\\/li>\\n<li>Automatically remove the home page from cache when requesting the detection of the browser preferred language<\\/li>\\n<li>Use relative urls for the admin language filter in admin bar. #209<\\/li>\\n<li>Disable auto translation of WP_Term_Query if it has a \'lang\' parameter<\\/li>\\n<li>Don\'t filter REST requests by default. #211<\\/li>\\n<li>Fix Yoast SEO statistics in dashboard showing only the default language. #211<\\/li>\\n<li>Fix WP Rocket clearing the cache of the wrong adjacent post<\\/li>\\n<li>Fix random header image<\\/li>\\n<li>Fix home page not correctly loaded when adding a query var<\\/li>\\n<li>Fix: Impossible to change the language code when the language code is also a WordPress locale.<\\/li>\\n<\\/ul>\\n<p>2.2.8 (2018-01-09)<\\/p>\\n<ul>\\n<li>Pro: Fix: Impossible to link past events by translation in The Events Calendar<\\/li>\\n<li>Disallow to delete translations of the default term for all taxonomies<\\/li>\\n<li>Fix: Auto add pages adds WooCommerce pages in default language to menus in all languages<\\/li>\\n<li>Fix most used tag cloud in Tags metabox in WP4.9+. Props P\\u00e4r Thernstr\\u00f6m. #208<\\/li>\\n<\\/ul>\\n<p>2.2.7 (2017-11-30)<\\/p>\\n<ul>\\n<li>Fix queries by taxonomy broken since WP 4.9<\\/li>\\n<li>Fix PHP notice in icl_object_id()<\\/li>\\n<\\/ul>\\n<p>2.2.6 (2017-11-22)<\\/p>\\n<ul>\\n<li>Pro: Fix query by post name and alternative language always returning the post in current language (when sharing slugs)<\\/li>\\n<li>Pro: Fix query by taxonomy and alternative language returning empty results<\\/li>\\n<li>Rework how translation files are loaded in ajax on front when the user is logged (in WP 4.7+)<\\/li>\\n<li>Add filter \'get_objects_with_no_lang_limit\'<\\/li>\\n<li>Force loading the admin side when using WP CLI (Props chrisschrijver)<\\/li>\\n<li>Fix check for terms with no language not scaling<\\/li>\\n<li>Fix pll_count_posts not working with multiple post types<\\/li>\\n<li>Fix inconsistent spacing between flag and language name in language switcher parent menu item (Props Amit Tal)<\\/li>\\n<li>Fix spacing between flag and language name when displaying an RTL language<\\/li>\\n<li>Fix get_terms not accepting comma separated values for \'lang\' parameter (Props Pavlo Zhukov)<\\/li>\\n<li>Fix possible wrong language detected in url when using subdomains (Props Pavlo Zhukov)<\\/li>\\n<li>Fix double escaped query<\\/li>\\n<\\/ul>\\n<p>2.2.5 (2017-11-09)<\\/p>\\n<ul>\\n<li>Update plugin updater class to 1.6.15<\\/li>\\n<li>Add $link in cache key of links filters<\\/li>\\n<li>Add support for \'nav_menu\' post type in wpml_object_id<\\/li>\\n<li>Fix conflict with Timber (introduced in 2.2.4)<\\/li>\\n<\\/ul>\\n<p>2.2.4 (2017-10-26)<\\/p>\\n<ul>\\n<li>Pro: Fix unknown language not redirected to default when using multiple domains<\\/li>\\n<li>Pro: Fix empty \'lang\' query var not deactivating the language query filter<\\/li>\\n<li>Pro: Fix conflict with The Events Calendar and Visual Composer when used together<\\/li>\\n<li>Add new filter `pll_hide_archive_translation_url` #174<\\/li>\\n<li>Add support for undocumented and deprecated WPML functions `wpml_object_id_filter` and `icl_get_current_language`<\\/li>\\n<li>Fix \'orderby\' and \'order\' in `wpml_active_languages`. Needs WP 4.7+<\\/li>\\n<li>Fix `icl_get_languages` not returning all languages when skip_missing = 0. Props Lo\\u00efc Blascos<\\/li>\\n<li>Fix `pll_translate_string` not working on admin #178<\\/li>\\n<li>Fix PHP Warning in widget video in WP 4.9<\\/li>\\n<li>Fix query using \'any\' post type not filtered per language (introduced in 2.2)<\\/li>\\n<li>Fix untranslatable string in About metabox. Props Farhad Sakhaei<\\/li>\\n<li>Fix error with PHP 7.1 and Duplicate Post. Props Enea Scerba<\\/li>\\n<li>Fix query auto translation not active in ajax requests on frontend<\\/li>\\n<li>Fix query auto translation for \'postname\' and \'pagename\'<\\/li>\\n<li>Fix terms query auto translation not working for \'include\' when no taxonomy is provided (WP 4.5+)<\\/li>\\n<\\/ul>\\n<p>2.2.3 (2017-09-24)<\\/p>\\n<ul>\\n<li>Fix editor removed on pages (introduced in 2.2.2)<\\/li>\\n<\\/ul>\\n<p>2.2.2 (2017-09-22)<\\/p>\\n<ul>\\n<li>Pro: Fix Duplicate post button not working when the user meta has been corrupted<\\/li>\\n<li>Fix PHP notice with the plugin Members #175<\\/li>\\n<li>Fix page template select displayed when editing a translated page for posts<\\/li>\\n<li>Fix incompatibility with WP 4.8.2 (placeholder %1$s in prepare)<\\/li>\\n<\\/ul>\\n<p>2.2.1 (2017-08-30)<\\/p>\\n<ul>\\n<li>Pro: partially refactor REST API classes<\\/li>\\n<li>Pro: Fix duplicate content user meta not removed from DB when uninstalling the plugin<\\/li>\\n<li>Fix strings translations not removed from DB when uninstalling the plugin<\\/li>\\n<li>Fix incorrect translation files loaded in ajax on front when the user is logged in (WP 4.7+)<\\/li>\\n<li>Fix widget language dropdown removed when saving a widget (introduced in 2.2)<\\/li>\\n<li>Fix queries with negative values for the \'cat\' parameter (introduced in 2.2 for queries made on frontend)<\\/li>\\n<li>Fix performance issue in combination with some plugins when the language is set from the content (introduced in 2.2)<\\/li>\\n<\\/ul>\\n<p>2.2 (2017-08-16)<\\/p>\\n<ul>\\n<li>Pro: Add support for the REST API<\\/li>\\n<li>Pro: Add integration with The Events Calendar<\\/li>\\n<li>Pro: Refactor ACF Pro integration for post metas and integrate term metas<\\/li>\\n<li>Pro: Ask confirmation if synchronizing a post overwrites an existing translation<\\/li>\\n<li>Pro: Separate sync post logic from interface<\\/li>\\n<li>Pro: Fix \'Detect browser language\' option automatically deactivated<\\/li>\\n<li>Pro: Fix redirect to 404 when the \'page\' slug translation includes non alphanumeric characters.<\\/li>\\n<li>Pro: Fix untranslated post type archive slug<\\/li>\\n<li>Pro: Fix ACF taxonomy fields not copied when the taxonomy is not translated #156<\\/li>\\n<li>Pro: Fix fatal error with ACF4<\\/li>\\n<li>Support a different content text direction in admin #45<\\/li>\\n<li>Add support for wildcards and \'copy-once\' attribute in wpml-config.xml<\\/li>\\n<li>Add minimal support for the filters \'wpml_display_language_names\' and \'icl_ls_languages\'<\\/li>\\n<li>Improve compatibility with the plugin WordPress MU Domain Mapping #116<\\/li>\\n<li>Improve speed of the sticky posts filter #41<\\/li>\\n<li>Remove redirect_lang option for multiple domains and subdomains<\\/li>\\n<li>Use secure cookie when using SSL<\\/li>\\n<li>Allow to copy\\/sync term metas with the filter \'pll_copy_term_metas\'<\\/li>\\n<li>Filter ajax requests in term.php according to the term language<\\/li>\\n<li>Add error message in customizer when setting an untranslated static front page #47<\\/li>\\n<li>Load static page class only if we are using a static front page<\\/li>\\n<li>Refactor parse_query filters to use the same code on frontend and admin<\\/li>\\n<li>Don\'t use add_language_to_link in filters<\\/li>\\n<li>Move ajaxPrefilter footer script on top<\\/li>\\n<li>Use wp_doing_ajax() instead of DOING_AJAX constant<\\/li>\\n<li>Fix queries custom tax not excluded from language filter on admin<\\/li>\\n<li>Fix WP translation not loaded when the language is set from the content on multisite.<\\/li>\\n<li>Fix the list of core post types in PLL_OLT_Manager for WP 4.7+<\\/li>\\n<li>Fix post name and tag slug incorrectly sanitized for German and Danish<\\/li>\\n<li>Fix lang attribute in dropdowns<\\/li>\\n<li>Fix wpml_permalink filter #139<\\/li>\\n<li>Fix WPML constants undefined on backend #151<\\/li>\\n<li>Fix a conflict with the plugin Custom Permalinks #143<\\/li>\\n<li>Fix menu location unexpectedly unset<\\/li>\\n<\\/ul>\\n<p>2.1.6 (2017-07-17)<\\/p>\\n<ul>\\n<li>Pro: fix duplicate post button not working in PHP 7.1<\\/li>\\n<li>Pro: fix CPTUI untranslated labels on admin<\\/li>\\n<li>Adapt related posts filter to use slug instead of name to follow changes made on Jetpack server ( Props Steve Kaeser )<\\/li>\\n<li>Fix PHP notices when translating CPT and custom tax titles in Yoast SEO<\\/li>\\n<li>Fix PHP warning when all plugins are networked activated<\\/li>\\n<\\/ul>\\n<p>2.1.5 (2017-05-31)<\\/p>\\n<ul>\\n<li>Add compatibility with new media widgets introduced in WP 4.8<\\/li>\\n<li>Removing the language information in URL for the default language is now default<\\/li>\\n<li>Update plugin updater class to 1.6.12<\\/li>\\n<li>Pro: fix PHP notices when duplicating the content<\\/li>\\n<li>Fix: test existence of `twentyseventeen_panel_count` instead of relying only on the active template<\\/li>\\n<li>Fix: set current property to false when removing the current-menu-item class #134 props @mowar<\\/li>\\n<li>Fix PHP notice when editing a term without language<\\/li>\\n<li>Fix possible PHP notice when deleting a category<\\/li>\\n<li>Fix fatal error with Gantry 5<\\/li>\\n<\\/ul>\\n<p>2.1.4 (2017-05-16)<\\/p>\\n<ul>\\n<li>Pro: fix user not logged in on secondary domain when previewing changes<\\/li>\\n<li>Pro: fix archive links without language code in ACF link field (ACF 5.4.0+)<\\/li>\\n<li>Fix redirection from www subdomain to wrong language domain.<\\/li>\\n<li>Fix: selecting \\\"Front page displays latest posts\\\" in the customizer not cleaning the languages cache<\\/li>\\n<li>Fix accessibility of the admin language switcher<\\/li>\\n<\\/ul>\\n<p>2.1.3 (2017-04-11)<\\/p>\\n<ul>\\n<li>Pro: Fix translated slug of \'page\' if it is translated to an empty string<\\/li>\\n<li>Update plugin udpater class to 1.6.11<\\/li>\\n<li>Strings registered with a wpml-config.xml file or WPML functions are now multiline by default<\\/li>\\n<li>Translate the site title in emails sent to the user<\\/li>\\n<li>Fix sanitize_user for specific locales<\\/li>\\n<li>Fix deprecation notice in Yoast SEO integration<\\/li>\\n<li>Fix: Clean term cache after the language has been set in mass #119<\\/li>\\n<\\/ul>\\n<p>2.1.2 (2017-03-09)<\\/p>\\n<ul>\\n<li>Pro: Add filter \'pll_xdata_nonce_life\'<\\/li>\\n<li>Pro: Fix translation of WooCommerce product attribute slug<\\/li>\\n<li>Pro: Fix product synchronization in WooCommerce 2.7<\\/li>\\n<li>Pro: Fix error message when bulk trashing synchronized posts<\\/li>\\n<li>Add option to discard item spacing in the output of pll_the_languages() ( Props Ceslav Przywara ) #93 #95<\\/li>\\n<li>Add as, dzo, kab, km, ml_IN, nl_BE, pa_IN, rhg, sah, ta_IN, tah, te, tt_RU to the predefined list of languages<\\/li>\\n<li>Update plugin updater class to 1.6.10<\\/li>\\n<li>Fix: Remove the dependency to is_ssl() to detect the language in the url ( language set from the directory name )<\\/li>\\n<li>Fix issue with secondary level domains<\\/li>\\n<li>Fix strings not translated in emails<\\/li>\\n<li>Fix incorrect usage of add_action() ( Props Peter J. Herrel ) #103<\\/li>\\n<li>Fix wrong redirect in customizer in WP 4.7<\\/li>\\n<\\/ul>\\n<p>2.1.1 (2017-02-15)<\\/p>\\n<ul>\\n<li>Pro: Add filter \'pll_enable_duplicate_media\' for a fine control of automatic media duplication<\\/li>\\n<li>Add filter \'pll_links_model\' for the links model class name<\\/li>\\n<li>Trim any starting ^ from modified rewrite rules<\\/li>\\n<li>Pro: Fix wrong count of plugins to udpate<\\/li>\\n<li>Fix slashed strings translations not saved #94<\\/li>\\n<\\/ul>\\n<p>2.1 (2017-01-25)<\\/p>\\n<ul>\\n<li>Minimum WordPress version is now 4.4<\\/li>\\n<li>Pro: Add support for synchronized posts (same post in multiple languages)<\\/li>\\n<li>Pro: Add support for custom post type UI and the Divi Builder<\\/li>\\n<li>Improve support of Yoast SEO (no category base and post type archive breadcrumb title)<\\/li>\\n<li>Move Languages menu at top level instead of submenu of the WordPress settings<\\/li>\\n<li>Copy the original post date when creating a translation and when the date is synchronized (Props Jory Hogeveen) #32<\\/li>\\n<li>Remove hreflang attributes on paged pages and paged posts<\\/li>\\n<li>Add label to widget language dropdown for better accessibility (Props Lawrence Francell) #53 #56<\\/li>\\n<li>Remove constants POLYLANG_URL and PLL_LOCAL_URL<\\/li>\\n<li>wp_get_sidebars_widgets() and is_active_sidebar() are now filtered according to widgets languages #54<\\/li>\\n<li>Add functions pll_esc_html__(), pll_esc_html_e(), pll_esc_attr__() and pll_esc_attr_e() to the API (Props jegbagus) #83<\\/li>\\n<li>Pro: Fix conflict between WooCommerce shop on front and translated shop base slug<\\/li>\\n<li>Pro: Fix $wp_rewrite search base and author_base not translated #68<\\/li>\\n<li>Pro: Fix page preview does not log in the user when using sudomains<\\/li>\\n<li>Fix: avoid setting the language cookie on 404 pages<\\/li>\\n<li>Fix: rewrite rules order modified for custom post types archives<\\/li>\\n<li>Fix: conflict with WP All Import causing our filters to fail in \\\"Add Media\\\" modal when editing a post<\\/li>\\n<li>Fix: auto add pages not working for nav menus assigned to several locations<\\/li>\\n<li>Fix: Jetpack infinite scroll for multiple domains #58 #74<\\/li>\\n<li>Fix: serialize error in Strings translations when balanceTags option is active #63<\\/li>\\n<li>Fix: static front page preview when redirected from the languages page #49<\\/li>\\n<li>Fix: Auto add pages not working for nav menus assigned to several locations<\\/li>\\n<li>Fix: Conflict with Woocommerce Show Single Variation<\\/li>\\n<li>Fix: Parent page not synchronized in Quick edit (introduced in 2.0.8)<\\/li>\\n<li>Fix: WPML API wpml_element_has_translations and wpml_post_language_details<\\/li>\\n<li>Fix: unattached media translations not in language switcher<\\/li>\\n<li>Fix: Conflict with WP Residence advanced search<\\/li>\\n<\\/ul>\\n<p>2.0.12 (2016-12-19)<\\/p>\\n<ul>\\n<li>Fix plugin not loaded first (introduced in 2.0.11)<\\/li>\\n<li>Fix wrong translations files loaded when the language is set from the content in WP 4.7 #76<\\/li>\\n<li>Fix notice when a tax query has no terms (using EXISTS or NOT EXISTS)<\\/li>\\n<\\/ul>\\n<p>2.0.11 (2016-12-12)<\\/p>\\n<ul>\\n<li>Pro: Fix shared term slugs broken by a late change in WP 4.7 #73<\\/li>\\n<li>Pro: Fix media taxonomies lost when creating a media translation when taxonomies sync is activated #72<\\/li>\\n<li>Fix fatal error in customizer when Twenty Seventen is activated and another theme is previewed #71<\\/li>\\n<li>Fix wrong plugin language on admin if user locale is different from site locale in WP 4.7<\\/li>\\n<\\/ul>\\n<p>2.0.10 (2016-12-05)<\\/p>\\n<ul>\\n<li>Add support for front page panels of Twenty Seventeen<\\/li>\\n<li>Remove draft posts from the language switcher even when the user is logged in<\\/li>\\n<li>Fix: Make argument 2 of icl_object_id optional<\\/li>\\n<li>Fix a conflict with the Divi theme (#67)<\\/li>\\n<\\/ul>\\n<p>2.0.9 (2016-11-15)<\\/p>\\n<ul>\\n<li>Fix javascript error in some ajax requests<\\/li>\\n<\\/ul>\\n<p>2.0.8 (2016-11-14)<\\/p>\\n<ul>\\n<li>Disable admin language feature in WP 4.7+<\\/li>\\n<li>Pro: fix case where a media could lose its parent post when translated on the fly by the content duplication<\\/li>\\n<li>Pro: fix on the fly media created at content duplication attached to parent page instead of child page<\\/li>\\n<li>Fix translations input fields not populated in languages metabox when creating a new translation in WP 4.7<\\/li>\\n<li>Fix possibility to delete the translations of the default category in WP 4.7<\\/li>\\n<li>Fix tag search not filtered per language in Quick edit in WP 4.7<\\/li>\\n<li>Fix dropdown language switcher not working for untranslated pages<\\/li>\\n<\\/ul>\\n<p>2.0.7 (2016-10-18)<\\/p>\\n<ul>\\n<li>Fix issues with static front pages introduced in version 2.0.6<\\/li>\\n<\\/ul>\\n<p>2.0.6 (2016-10-17)<\\/p>\\n<ul>\\n<li>Pro: Fix translated paged slug not working on paged static front page<\\/li>\\n<li>Add support for WPML filter \'wpml_language_form_input_field\'<\\/li>\\n<li>Fix PHP notice when using the WPML filter \'wpml_current_language\'<\\/li>\\n<li>Fix cases where the admin language filter is not correctly taken into account<\\/li>\\n<li>Fix paged static front pages in plain permalinks<\\/li>\\n<li>Fix paged static front pages for multiple domains (#43)<\\/li>\\n<li>Fix warning occuring when a 3rd party plugin attempts to register anything but a string in the strings translations panel<\\/li>\\n<li>Fix cross domain http request for media when using multiple domains or subdomains<\\/li>\\n<li>Fix error 404 on pages when no language has been created yet<\\/li>\\n<\\/ul>\\n<p>2.0.5 (2016-09-22)<\\/p>\\n<ul>\\n<li>Pro: Fix conflict with WPBakery Visual Composer<\\/li>\\n<li>Pro: Fix conflict between multiple domains SSO and FORCE_SSL_ADMIN<\\/li>\\n<li>Pro: Fix duplicated fields not displayed in new translation in ACF Pro 5.4+<\\/li>\\n<li>Add Tibetan and Silesian to the predefined languages list<\\/li>\\n<li>Remove duplicated strings from the strings translations (even when they have a different name or group)<\\/li>\\n<li>The languages and translations of custom post types and taxonomies are no more activated by default at activation<\\/li>\\n<li>Allow to deactivate auto translation in secondary by setting \'lang\' to an empty value<\\/li>\\n<li>Fix: invalidate the cache of PLL_MO ids when adding a new language<\\/li>\\n<li>Fix: don\'t filter secondary queries when editing a post in an untranslated post type<\\/li>\\n<\\/ul>\\n<p>2.0.4 (2016-09-06)<\\/p>\\n<ul>\\n<li>Add Gujarati to the predefined languages list<\\/li>\\n<li>Fix conflict with Page Builder. Other parts of the conflict are fixed in Page Builder 2.4.14<\\/li>\\n<li>Fix plugins translations incorrectly loaded in WP 4.6<\\/li>\\n<li>Fix error 404 on paged urls when using a non standard port<\\/li>\\n<\\/ul>\\n<p>2.0.3 (2016-08-16)<\\/p>\\n<ul>\\n<li>Pro: Fix PHP notice when hiding the language code in url and the language is set from subdomains<\\/li>\\n<li>Pro: Fix one more media being created when the duplicate media in all languages is activated (introduced in 2.0)<\\/li>\\n<li>Pro: Fix shared term slugs not working on PHP 7<\\/li>\\n<li>Pro: Fix Polylang storing integers in some ACF Pro fields where ACF Pro stores strings<\\/li>\\n<li>Pro: Fix ACF Pro custom fields synchronized even when the custom fields synchronization option is deactivated (#40)<\\/li>\\n<li>Fix PHP notice: Undefined variable: original_value in \\/modules\\/wpml\\/wpml-api.php on line 168<\\/li>\\n<li>Fix translations loaded too soon by plugins not correctly reloaded since WP 4.6 (#39)<\\/li>\\n<li>Fix: Remove the delete link for translations of the default category on PHP 7<\\/li>\\n<li>Fix unescaped i18n strings in Lingotek presentation<\\/li>\\n<\\/ul>\\n<p>2.0.2 (2016-08-03)<\\/p>\\n<ul>\\n<li>Avoid fatal error when a 3rd party theme or plugin has a malformed wpml-config.xml file: the malformed wpml-config.xml file is simply ignored<\\/li>\\n<\\/ul>\\n<p>2.0.1 (2016-08-02)<\\/p>\\n<ul>\\n<li>Fix fatal error on PHP &lt; 5.4 (introduced in 2.0)<\\/li>\\n<li>Fix custom flags not being loaded (introduced in 2.0)<\\/li>\\n<\\/ul>\\n<p>2.0 (2016-08-02)<\\/p>\\n<ul>\\n<li>Pro: Improve integration with ACF Pro<\\/li>\\n<li>Pro: Add support for single sign on across multiple domains or subdomains<\\/li>\\n<li>Pro: Add support for browser language detection when using multiple domains<\\/li>\\n<li>Pro: Add support for translation of the static portion of the post permalink structure<\\/li>\\n<li>Pro: Fix deactivated languages appearing in Yoast SEO sitemaps<\\/li>\\n<li>Pro: Fix impossibility to visit a deactivated language when using subdomains or multiple domains (#10)<\\/li>\\n<li>Pro: Fix when sharing slug on the page for posts, only one of them is accessible (#33)<\\/li>\\n<li>Add the possibility to use the language switcher as dropdown in menu<\\/li>\\n<li>Add support for custom logo introduced in WP 4.5 (#6)<\\/li>\\n<li>The backend current language ( PLL()-&gt;curlang ) is now equal to the language of current post or term being edited (#19)<\\/li>\\n<li>The sample permalink is now updated when changing the language in the Languages metabox<\\/li>\\n<li>Revamp the wpml-config.xml reader to use simplexml instead of our custom xml parser<\\/li>\\n<li>Improve support for the WPML API (including Hook API introduced in WPML 3.2)<\\/li>\\n<li>Add support for translation of meta titles and descriptions of custom post types and custom taxonomies in Yoast SEO<\\/li>\\n<li>Replace uncached functions by WPCOM VIP functions when available<\\/li>\\n<li>Improve compatibility with WP 4.6<\\/li>\\n<li>Fix parent category wrongly assigned to post when synchronizing children categories (#21)<\\/li>\\n<li>Fix custom fonts not loaded when using multiple domains or subdomains<\\/li>\\n<li>Fix remove_accents() not working for German and Danish (#24)<\\/li>\\n<li>Fix incorrect static front pages urls on backend<\\/li>\\n<li>Fix impossible to directly enter the page number in strings translation table (introduced in 1.9.3)<\\/li>\\n<li>Fix conflict with WP Sweep (needs WP Sweep 1.0.8+)<\\/li>\\n<li>Fix potential performance issue by querying only taxonomies to show in quick edit to filter the category checklist<\\/li>\\n<li>Fix conflict (database error) with ReOrder-posts-within-categories plugin<\\/li>\\n<li>Fix languages per page option not saved<\\/li>\\n<\\/ul>\\n<p>1.9.3 (2016-06-28)<\\/p>\\n<ul>\\n<li>Pro: Allow to add slashes in url slugs translations<\\/li>\\n<li>\\u00a0Pro: Fix archive links not using translated slugs<\\/li>\\n<li>Pro: Fix visitor being redirected to 404 if his browser preference is set to an inactive language<\\/li>\\n<li>Fix strings translations table always back to page 1 when submitting the form (#14)<\\/li>\\n<li>Fix get_pages( array( \'lang\' =&gt; \'\' ) ) not querying all the languages<\\/li>\\n<li>Fix switching the admin language filter can override the static front page settings (#16)<\\/li>\\n<\\/ul>\\n<p>1.9.2 (2016-06-06)<\\/p>\\n<ul>\\n<li>Pro: fix unreachable hierarchical custom post type posts when they are sharing slugs across languages<\\/li>\\n<li>Fix missing argument 3 in icl_t<\\/li>\\n<li>Fix conflict with WooCommerce product variations<\\/li>\\n<\\/ul>\\n<p>1.9.1 (2016-05-23)<\\/p>\\n<ul>\\n<li>Pro: add compatibility with Beaver Builder<\\/li>\\n<li>Pro: fix media wrongly created when adding a new media translation<\\/li>\\n<li>Add azb, ceb, de_CH_informal, es_GT, mr, nl_NL_formal to the predefined list of languages<\\/li>\\n<li>Fix the language switcher not linking to media translations for anonymous visitors<\\/li>\\n<\\/ul>\\n\"]}\";}', 'no');
